import React, { useState } from "react";
import {
  NavbarContainer,
  LeftContainer,
  NavbarExtendedContainer,
  NavbarInnerContainer,
  NavbarLinkContainer,
  NavbarLink,
  OpenLinksButton,
  NavbarLinkExtended,
} from "../styles/Navbar.style";

function Navbar() {
  const [extendNavbar, setExtendNavbar] = useState(false);

  return (
    <NavbarContainer extendNavbar={extendNavbar}>
      <NavbarInnerContainer>
        <LeftContainer>
          <NavbarLinkContainer>
            <NavbarLink to="/Home"> Home</NavbarLink>
            <NavbarLink to="/userLogin"> Login</NavbarLink>
            <NavbarLink to="/userRegis"> Register</NavbarLink>
            <NavbarLink to="/Inquiry"> Inquiry</NavbarLink>
            <OpenLinksButton
              onClick={() => {
                setExtendNavbar((curr) => !curr);
              }}
            >
              {extendNavbar ? <>&#10005;</> : <> &#8801;</>}
            </OpenLinksButton>
          </NavbarLinkContainer>
        </LeftContainer>
      </NavbarInnerContainer>
      {extendNavbar && (
        <NavbarExtendedContainer>
          <NavbarLinkExtended to="/Home"> Home</NavbarLinkExtended>
          <NavbarLinkExtended to="/userLogin"> Login</NavbarLinkExtended>
          <NavbarLinkExtended to="/userRegis"> Register</NavbarLinkExtended>
          <NavbarLinkExtended to="/Inquiry"> Inquiry</NavbarLinkExtended>
        </NavbarExtendedContainer>
      )}
    </NavbarContainer>
  );
}

export default Navbar;
